export function checkBIN(bin){
  let cleanBIN = bin.replace(/\D/g, '');

  if (cleanBIN === ""){
    return {isValid: false, message: '  !'}
  }

  if (cleanBIN.length > 6){
    cleanBIN = cleanBIN.slice(0, 6);
  }

  if(cleanBIN.length !== 6){
    return{isValid: false, message:'  !'}
  }

  const foundData = binData[cleanBIN];
  if(!foundData){
    return{isValid: false, message: '    !'}
  }

  return{isValid: true, data: foundData};
}

